import React from "react";
import ReactRoundedImage from "react-rounded-image";
import MyPhoto from "./ProfilePic.jpeg";

function ProfilePicture() {
	return (
		<div style={{ display: "flex" }}>
			<ReactRoundedImage
				image={MyPhoto}
				roundedSize='0'
				imageWidth='150'
				imageHeight='150'
			/>
		</div>
	);
}

function HomePage() {
	return (
		<div>
			<ProfilePicture />
		</div>
	);
}

export default HomePage;
